import React from 'react';
import Cookies from 'universal-cookie';
import 'bootstrap/dist/css/bootstrap.min.css';
import Menu from './Menu';
import '../styles/welcome.css';

function Welcome() {
    const cookies = new Cookies();
    return (
        <>
            <Menu />
            <div style={{ float: 'right', width: '85%' }}>
                <h1>Bienvenido {cookies.get('nombre')} {cookies.get('apellidos')}</h1>
                <section className='container px-4'>
                    <div className='div1'>
                        <h2 className='ml-2'>Aranda News</h2>
                        <p>Ent√©rate de todas las noticias y novedades que trajo el segundo trimestre del 2021</p>
                    </div>
                    <div className='div2'>
                    <img width="273" height="238" src="https://arandasoft.com/wp-content/uploads/2021/05/img-banner-comunicados-prensa-04.png" alt="" loading="lazy" srcset="https://arandasoft.com/wp-content/uploads/2021/05/img-banner-comunicados-prensa-04.png 473w, https://arandasoft.com/wp-content/uploads/2021/05/img-banner-comunicados-prensa-04-300x278.png 300w" sizes="(max-width: 473px) 100vw, 473px"/>
                    </div>

                </section>
            </div>
        </>
    )
}


export default Welcome;
